var amp, freq, decay, a, n, et, t, v;
amp = 0.1;
freq = 10;
decay = 2;
a = numKeys;
n = nearestKey(time).index;
et = key(n).time;
t = $bm_sub(time, et);
$bm_rt = v = velocityAtTime($bm_sub(et, 0.01));
if (t > 0 & n >= a) {
    $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin($bm_mul(t, freq))), Math.exp($bm_mul(t, decay))));
} else {
    $bm_rt = value;
}

s.x:
var $bm_rt;
var amp, freq, decay, n, n, t, t, v;
amp = 0.1;
freq = 2;
decay = 2;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time) {
        n--;
    }
}
if (n == 0) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = $bm_sub(time, key(n).time);
}
if (n > 0) {
    v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
    $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t))));
} else {
    $bm_rt = value;
}
